class ProjectRoleResponseModel {  List<ProjectRoleModel>? data;  ProjectRoleResponseModel({this.data});  ProjectRoleResponseModel.fromJson(List<dynamic>? json) {    if (json != null) {      data = <ProjectRoleModel>[];      json.forEach((v) {        data!.add(new ProjectRoleModel.fromJson(v));      });    }  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    if (this.data != null) {      data['Data'] = this.data!.map((v) => v.toJson()).toList();    }    return data;  }}class ProjectRoleModel {  int? manageProjectRoleId;  String? manageProjectRoleCode;  String? manageProjectRoleName;  int? isActive;  String? createdAt;  int? createdBy;  bool? isSelected;  ProjectRoleModel(      {this.manageProjectRoleId,        this.manageProjectRoleCode,        this.manageProjectRoleName,        this.isActive,        this.createdAt,        this.createdBy, this.isSelected = false});  ProjectRoleModel.fromJson(Map<String, dynamic> json) {    manageProjectRoleId = json['manage_project_role_id'];    manageProjectRoleCode = json['manage_project_role_code'];    manageProjectRoleName = json['manage_project_role_name'];    isActive = json['is_active'];    createdAt = json['created_at'];    createdBy = json['created_by'];    this.isSelected = false;  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['manage_project_role_id'] = this.manageProjectRoleId;    data['manage_project_role_code'] = this.manageProjectRoleCode;    data['manage_project_role_name'] = this.manageProjectRoleName;    data['is_active'] = this.isActive;    data['created_at'] = this.createdAt;    data['created_by'] = this.createdBy;    return data;  }}